SELECT COUNT(*) FROM tag AS t, site AS s, question AS q, tag_question AS tq WHERE t.site_id = s.site_id AND q.site_id = s.site_id AND tq.site_id = s.site_id AND tq.question_id = q.id AND tq.tag_id = t.id AND s.site_name IN ('stackoverflow') AND t.name IN ('android-volley', 'angular6', 'arm', 'asp.net-mvc-2', 'copy', 'dart', 'interface-builder', 'internet-explorer-11', 'jqgrid', 'namespaces', 'oracle11g', 'selenium', 'silverlight') AND q.score >= 1 AND q.score <= 10